import React from "react";
import { useTranslation } from "react-i18next";
import "./AboutMe.css";

export default function AboutMe() {
  const { t } = useTranslation();
  return (
    <div>
      <p className="aboutMeText">{t("aboutMeText")}</p>
    </div>
  );
}
